import React from "react";
import s from "../styles/avatar.module.scss";

export const Avatar = () => {
  return <div className={s.avatar}>
           <img className={s.avatar-img} src="https://www.pngitem.com/pimgs/m/240-2408128_tasmanian-devil-cartoon-painting-hd-png-download.png" alt="tazzz" />
         </div>;
};
